import React, { useState, useEffect } from "react";
import { makeStyles } from "@material-ui/styles";
import { func } from "prop-types";
import {
  Typography,
  Grid,
  Card,
  CardContent,
  CardActions,
  Button,
  Avatar,
  CardHeader
} from "@material-ui/core";
import Paper from "@material-ui/core/Paper";

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData("Frozen yoghurt", 159, 6.0, 24, 4.0),
  createData("Ice cream sandwich", 237, 9.0, 37, 4.3),
  createData("Eclair", 262, 16.0, 24, 6.0),
  createData("Cupcake", 305, 3.7, 67, 4.3),
  createData("Gingerbread", 356, 16.0, 49, 3.9),
];

const useStyles = makeStyles((theme) => ({
  root: {
    padding: theme.spacing(3),
  },
  bullet: {
    display: "inline-block",
    margin: "0 2px",
    transform: "scale(0.8)",
  },
  title: {
    fontSize: 14,
  },
  loyerBox: {
    marginLeft: 12,
  },
  actionBar: {
    backgroundColor: "#FFF675",
  },
}));

const Accommodation = () => {
  const classes = useStyles();
  const currentDate = new Date().toLocaleString("default", {
    month: "long",
    year: "numeric",
  });
  const text =
    "<div> <div>HELLO </div> <div style={text-align:'right'}> WORLD </div></div>";

  return (
    <div className={classes.root}>
      <Typography variant="h1">VOICI TES LOGEMENTS</Typography>

      <Grid container spacing={3}>
        {rows !== null &&
          rows.map((product) => (
            <Grid item key={product.name} lg={4} md={6} xs={12}>
              <Card variant="contained">
                <CardHeader
                  avatar={
                    <Avatar aria-label="recipe" className={classes.avatar}>
                      V
                    </Avatar>
                  }
                  title="23 RUE HENRI MARTIN - 92170 VANVES"
                  subheader="Appartement 1A"
                />
                <CardContent>
                  <Typography variant="h4">

                  </Typography>
                  <Typography variant="h5" component="h2">

                  </Typography>
                  <Typography>Locataire(s) : MME CETRE</Typography>
                  <Typography component="p">Loyer :</Typography>
                  <Typography className={classes.loyerBox}>
                    Fixe : 300
                  </Typography>
                  <Typography className={classes.loyerBox}>
                    Charge : 100
                  </Typography>
                  <Typography className={classes.loyerBox}>
                    TVA : 20%
                  </Typography>
                  <Typography className={classes.loyerBox}>
                    Total : 450
                  </Typography>
                  <TextField id="outlined-basic" label="Outlined" variant="outlined" />
                </CardContent>
                <CardActions className={classes.actionBar}>
                  <Button size="small">Supprimer</Button>
                  <Button size="small">Modifier</Button>
                </CardActions>
              </Card>
            </Grid>
          ))}
      </Grid>
    </div>
  );
};

export default Accommodation;
